import styled from "styled-components";
import PlaceHolder from "../../images/place_holder.png";

const GridProjetos = styled.div`
    margin-left: 0; 
    display: flex;
    flex-wrap: wrap; 
    justify-content: space-between;
    width: 100%; 
    box-sizing: inherit;
`;

const BoxProjetos = styled.div`
    padding-top: 56.25%;
    background-position: center;
    background-repeat: no-repeat;
    border-radius: 7px;
    display: block; 
    width: 100%;
`;

function Projetos() {
    return (
        <GridProjetos>
            <BoxProjetos>
                <a href="" style="background-image: https://picsum.photos/seed/picsum/200/300">
                </a>
            </BoxProjetos>
        </GridProjetos>
    );
}

export default Projetos;
